import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";
import { Layout, Menu } from "antd";
import logo_image from "../../img/nexpus_logo_ver2.0_green(40px).png";

const { Header, Content, Sider } = Layout;
const LangdingLayout = ({ children }) => {
  return (
    <Layout>
      <Header className="header">
        <div className="logo" />
        <Menu theme="dark" mode="horizontal" defaultSelectedKeys={["2"]}>
          <Menu.Item key="1">nav 1</Menu.Item>
          <Menu.Item key="2">nav 2</Menu.Item>
          <Menu.Item key="3">nav 3</Menu.Item>
        </Menu>
      </Header>

      <div className="root">
        <div className="root_navbar">
          <div className="container">
            <a href="/" className="logo text-uppercase">
              <img src={logo_image} alt="Logo"></img>
              <p>NextPus</p>
            </a>
          </div>
        </div>
        <div>
          <Menu mode="horizontal">
            <Menu.Item>
              <Link href="/login">
                <a>로그인</a>
              </Link>
            </Menu.Item>
            <Menu.Item>
              <Link href="/profile">
                <a>회원가입</a>
              </Link>
            </Menu.Item>
          </Menu>
        </div>
        {children}
      </div>
    </Layout>
  );
};

LangdingLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default LangdingLayout;
